import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <nav>
        <tbody>
          <tr>
              <td><Link to="/">Home</Link></td>
              <td><Link to="/artistList">Artist</Link></td>
              <td><Link to="/add">Add artist</Link></td>
          </tr>
        </tbody>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
